    \ Story10. M\xFAsica de estilo livre Letras\n\nGerador de lote\n\n\n\nN\xE3o salvo\
    \ Saltar para op\xE7\xF5es para compartilhar, comentar e votar.\nCurr de Obfus\
    \ de Hungry\nUma hist\xF3ria curta\npor Jim\nObfus Curr olhou para a faca peculiar\
    \ em suas m\xE3os e sentiu medo.\nEle andou at\xE9 a janela e refletiu em seu\
    \ ambiente assustador. Ele sempre amou o pitoresco Falmouth com suas tontas perturbados.\
    \ Era um lugar que encorajou sua tend\xEAncia a sentir medo.\nEnt\xE3o viu algo\
    \ \xE0 dist\xE2ncia, ou melhor algu\xE9m. Era a figura de Ambien Cain. Ambien\
    \ era um elefante amoroso com verrugas largas e pestanas picantes.\nObfus engravidou.\
    \ Ele olhou para o seu pr\xF3prio reflexo. Ele era um bebedor de vinho com verrugas\
    \ bonitas e pestanas castanhas. Seus amigos o viam como um murado de olhos largos\
    \ e selvagens. Uma vez, ele at\xE9 tinha revivido um p\xE1ssaro moribundo e ferido.\
    \ Mas nem mesmo uma pessoa faminta que uma vez reviveu um p\xE1ssaro moribundo,\
    \ ferido, estava preparada para o que Ambien tinha na loja hoje. A chuva martelado\
    \ como assobiar p\xE1ssaros, fazendo o Obfus ambivalent.\nQuando Obfus saiu e\
    \ Ambien se aproximou, ele poderia ver o sorriso purring em seu rosto.\n\"Eu estou\
    \ aqui porque quero justi\xE7a\", Ambien bellowed, em um tom doce. Ele bateu seu\
    \ punho contra o peito de Obfus, com a for\xE7a de 5874 garrafas azuis. \"Eu amo-te,\
    \ Obfus Curr\".\nObfus olhou para tr\xE1s, ainda mais ambivalente e ainda dedilhando\
    \ a faca peculiar. \"Ambien, eu n\xE3o tenho o dinheiro\", ele respondeu.\nEles\
    \ olharam um para o outro com sentimentos ativos, como dois maggots movidos, magn\xED\
    ficos rindo de um bar muito atencioso mitzvah, que tinha m\xFAsica cl\xE1ssica\
    \ tocando no fundo e dois tios carinhosos pensando na batida.\nObfus estudou verrugas\
    \ largas de Ambien e pestanas picantes. Eventualmente, ele respirou profundamente.\
    \ \"Desculpe, mas n\xE3o posso dar-lhe justi\xE7a\", explicou, em tons de piedade.\n\
    Ambien parecia irritado, seu corpo cru como um mapa poderoso e moderno.\nObfus\
    \ poderia realmente ouvir o corpo de Ambien quebrar em 3833 peda\xE7os. Ent\xE3\
    o o elefante amoroso apressou-se para longe. Nem um copo de vinho acalmaria os\
    \ nervos do Obfus esta noite.\nO Reino\n\nPor raz\xF5es de privacidade, sua cria\xE7\
    \xE3o ser\xE1 removida da web \xE0s 8:30h BST e depois exclu\xEDda do nosso servidor,\
    \ a menos que voc\xEA opte por public\xE1-lo.\nou\n\n\n\n\n(As cria\xE7\xF5es\
    \ abertas est\xE3o dispon\xEDveis para qualquer pessoa com o link.) Vota\xE7\xE3\
    o e coment\xE1rios s\xF3 est\xE3o dispon\xEDveis em trabalhos publicados.\nAuto\
    \ Praise para Hungry Obfus Curr\n\"Sinto que conhe\xE7o o Obfus Curr. De certa\
    \ forma, parece que sempre o conheci\".\n- O Conto Di\xE1rio\n\xABAbout as enjoyable\
    \ as being hailed on while take in washing that has been target by seagulls with\
    \ the squits\xBB (em ingl\xEAs). - Enid Kibbler\n\xABSaying the rain Hammered\
    \ like bouncing humming aves is just the kind of liter device that makes this\
    \ bright\xBB (em ingl\xEAs).\n- Acerta na Spoof\n\"Eu poderia fazer melhor\".\n\
